// Import your screenshot image (change the path if it's different)
import screenshot from './petfinder.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* Full-screen image */}
        <img src={screenshot} className="fullscreen-image" alt="screenshot" />
      </header>
    </div>
  );
}

export default App;
